;; **
;;; ### Binning
;; **

;; @@
(defn bin
  [n-bins xs]
  (let [min-x (apply min xs)
        max-x (apply max xs)
        range-x (- max-x min-x)
        bin-fn (fn [x]
                 (-> x
                     (- min-x)
                     (/ range-x)
                     (* n-bins)
                     (int)
                     (min (dec n-bins))))]
    (map bin-fn xs)))
