;; **
;;; ### Poincar's baker
;;; 
;;; Poincar after weighing his bread for a year discovered that while the weights followed a normal distribution, the peak was at 950g rather than 1kg.
;;; 
;;; Since baking was regulated the authorities fined the baker, but Poincar kept weighing his bread for another year.
;;; 
;;; The mean was now 1kg, but the distribution wasn't symmetrical anymore: it was skewed to the right, consistent with the baker giving Poincar the heaviest bread.
;;; 
;;; Needless to say, the baker got fined another time.
;;; 
;;; ### Generating distributions
;;; 
;;; The previous story is helpful to help us develop an intuition about the **normal distribution** and **variance**.
;;; 
;;; We will model an honest and a dishonest baker.
;; **

;; @@
(defn honest-baker
  [mean sd]
  (let [distribution (d/normal-distribution 
                       mean sd)]
    (repeatedly #(d/draw distribution))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/honest-baker</span>","value":"#'ws.ch1/honest-baker"}
;; <=

;; @@
(-> (take 10000 (honest-baker 1000 30))
    (c/histogram :nbins 25)
    (chart-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #object[org.jfree.chart.JFreeChart 0xceaef52 \"org.jfree.chart.JFreeChart@ceaef52\"], :opts nil}"}
;; <=

;; @@
(defn dishonest-baker
  [mean sd]
  (let [distribution (d/normal-distribution
                       mean sd)]
    (->> (repeatedly #(d/draw distribution))
         (partition 13)
         (map (partial apply max)))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/dishonest-baker</span>","value":"#'ws.ch1/dishonest-baker"}
;; <=

;; @@
(-> (take 10000 (dishonest-baker 950 30))
    (c/histogram :nbins 25)
    (chart-view))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/PNG;base64,\"/>","value":"#incanter_gorilla.render.ChartView{:content #object[org.jfree.chart.JFreeChart 0x5db39826 \"org.jfree.chart.JFreeChart@5db39826\"], :opts nil}"}
;; <=

;; **
;;; ## Skewness
;;; 
;;; The one above is a **skewed normal distribution**. **Negative skew** or **left skew** indicates that the area under the graph is larger on the left side, while **positive skew** or **right skew** indicates the opposite.
;; **

;; @@
(let [weights (take 10000 (dishonest-baker 950 30))]
  {:mean (mean weights)
   :median (median weights)
   :skewness (s/skewness weights)})
