;; **
;;; ## Cumulative distribution functions
;;; 
;;; **CDFs** describe the probability that a value drawn from a distribution will have a value less than `x`.
;;; 
;;; For example, let's say I roll a die, what would be the probability that I'll roll less than a 6?
;;; 
;;; The probability to roll a five or lower is @@\frac{5}{6}@@, conversely the probability to roll a 1 is @@\frac{1}{6}@@.
;; **

;; @@
(let [sample-honest (->> (honest-baker 1000 30)
                         (take 1000))
      sample-dishonest (->> (dishonest-baker 950 30)
                            (take 1000))
      ecdf-honest (s/cdf-empirical sample-honest)
      ecdf-dishonest (s/cdf-empirical sample-dishonest)]
  (-> (c/xy-plot sample-honest 
                 (map ecdf-honest 
                      sample-honest)
                 :x-label "Weight"
                 :y-label "Probability"
                 :legend true
                 :series-label "Honest baker")
      (c/add-lines sample-dishonest
                   (map ecdf-dishonest 
                        sample-dishonest)
                   :series-label "Dishonest baker")
      (chart-view)))
