;; **
;;; ## Probability mass functions
;;; 
;;; With **PMF** we plot the probability that a number drawn from a distribution will be exactly equal to a given value.
;;; 
;;; Before plotting a **PMF** we need to normalize data
;; **

;; @@
(defn as-pmf
  [bins]
  (let [histogram (frequencies bins)
        total (reduce + (vals histogram))]
    (->> histogram
         (map (fn [[k v]]
                [k (/ v total)]))
         (into {}))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;ws.ch1/as-pmf</span>","value":"#'ws.ch1/as-pmf"}
;; <=

;; @@
(let [n-bins 40
      uk (->> (load-data :uk-victors)
              (i/$ :turnout)
              (bin n-bins)
              (as-pmf))
      ru (->> (load-data :ru-victors)
              (i/$ :turnout)
              (bin n-bins)
              (as-pmf))]
  (-> (c/xy-plot (keys uk) (vals uk)
                 :series-label "UK"
                 :legend true)
      (c/add-lines (keys ru) (vals ru)
                   :series-label "Russia")
      (chart-view)))
